postcontent:
Looking for a decent AK-47 with the following features:

Side-folding stock (prefer wire but will entertain all kinds);
Chrome-lined, threaded barrel;
Upgraded pistol grip;
Black handguard;
Norinco, Poly-tech, Maadi, Arsenal or converted Saiga receiver;
Able to accept standard AK-47 magazines;
and milsurp or steel framed waffle magazines.

It's even better if your AK has a rear peep sight, can accommodate a scope mount, and has a dimpled receiver.

NO CENTURY.
NO WASR.
NO Ohio Ordnance receivers.
No Tapco magazines.
No canting to sights or gas system.
No AMD-65s.

Price can be negotiable but we all know that a decent AK can still be had for around $600 and a good one for $700.  I'm willing to pay more if you have several quality magazines, a sling, or other accessories that command a higher price, but let's be fair.  I won't pay $1,000 for an AK-47 just like I wouldn't expect you to pay $1400 for my AR-15 or $700 for my Glock.  If you have ammo, quality mags, a sling, rail, spare parts, etc. then of course I am willing to pay more; it just has to be justified; I'm on a budget (like everyone else these days).  I'd also be interested in any Golden Tiger ammo.

Email works best for now.
